import React from 'react';
import classes from './Welcome.module.css';

import Backdrop from '../Backdrop/Backdrop';

export default function Welcome() {
    return (
        <React.Fragment>
        <Backdrop show={true}/>
        <div className={classes.welcome}>
            <h2>Hello!</h2>
            <p>
                Thank you very much for taking a look at my web app. I built 
                it in April/May 2021 to put my React.js knowledge to practice. 
                Enjoy playing it and feel free to learn more about me and the 
                building process in the "About" section.
                <br/>
                <br/>
                Have a nice day!
            </p>
        </div>
        </React.Fragment>
    );
}
